import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { FaBars, FaTimes, FaMoon, FaSun, FaUser, FaStar, FaBookOpen } from "react-icons/fa";

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(
    localStorage.getItem("darkMode") === "true"
  );
  const [menuOpen, setMenuOpen] = useState(false);
  const [horoscopeDropdown, setHoroscopeDropdown] = useState(false);

  useEffect(() => {
    if (darkMode) {
      document.documentElement.classList.add("dark");
    } else {
      document.documentElement.classList.remove("dark");
    }
    localStorage.setItem("darkMode", darkMode);
  }, [darkMode]);

  return (
    <nav className="bg-white dark:bg-gray-900 shadow-lg fixed top-0 left-0 w-full z-50 transition-all">
      <div className="max-w-7xl mx-auto px-6 flex justify-between items-center py-4">
        {/* Logo */}
        <Link to="/" className="text-3xl font-bold text-yellow-500 transition hover:scale-105 flex items-center">
          🔮 AstroSphere
        </Link>

        {/* Desktop Menu */}
        <ul className="hidden md:flex space-x-6 text-gray-700 dark:text-white font-medium">
          <li>
            <Link to="/" className="hover:text-yellow-400 transition flex items-center">
              <FaStar className="mr-2" /> Home
            </Link>
          </li>
          <li className="relative">
            <button
              onClick={() => setHoroscopeDropdown(!horoscopeDropdown)}
              className="hover:text-yellow-400 transition flex items-center"
            >
              <FaBookOpen className="mr-2" /> Horoscope ▼
            </button>
            {horoscopeDropdown && (
              <ul className="absolute left-0 mt-2 bg-white dark:bg-gray-800 shadow-md rounded-lg p-2 w-48">
                <li>
                  <Link to="/horoscope" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">
                    Daily Horoscope
                  </Link>
                </li>
                <li>
                  <Link to="/horoscope?weekly" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">
                    Weekly Horoscope
                  </Link>
                </li>
              </ul>
            )}
          </li>
          <li>
            <Link to="/compatibility" className="hover:text-yellow-400 transition flex items-center">
              ❤️ Compatibility
            </Link>
          </li>
          <li>
            <Link to="/premium-consult" className="hover:text-yellow-400 transition flex items-center">
              🌟 Premium Consultation
            </Link>
          </li>
          <li>
            <Link to="/blog" className="hover:text-yellow-400 transition flex items-center">
              📖 Blog
            </Link>
          </li>
        </ul>

        {/* Buttons */}
        <div className="flex items-center space-x-4">
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="text-gray-700 dark:text-white text-lg transition"
          >
            {darkMode ? <FaSun /> : <FaMoon />}
          </button>
          <Link to="/login" className="px-4 py-2 bg-yellow-500 text-black rounded-full hover:bg-yellow-600 transition flex items-center">
            <FaUser className="mr-2" /> Login
          </Link>
        </div>

        {/* Mobile Menu Button */}
        <button
          className="md:hidden text-gray-700 dark:text-white text-2xl"
          onClick={() => setMenuOpen(!menuOpen)}
        >
          {menuOpen ? <FaTimes /> : <FaBars />}
        </button>
      </div>

      {/* Mobile Menu */}
      {menuOpen && (
        <ul className="md:hidden bg-white dark:bg-gray-900 shadow-md p-4 text-center">
          <li><Link to="/" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Home</Link></li>
          <li><Link to="/horoscope" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Daily Horoscope</Link></li>
          <li><Link to="/horoscope?weekly" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Weekly Horoscope</Link></li>
          <li><Link to="/compatibility" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Compatibility</Link></li>
          <li><Link to="/premium-consult" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Premium Consultation</Link></li>
          <li><Link to="/blog" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Blog</Link></li>
          <li>
            <button onClick={() => setDarkMode(!darkMode)} className="block w-full py-2 text-gray-700 dark:text-white hover:text-yellow-400">
              {darkMode ? "🌞 Light Mode" : "🌙 Dark Mode"}
            </button>
          </li>
        </ul>
      )}
    </nav>
  );
};

export default Navbar;
